const ongoingsRequested = () => {
    return {
        type: 'FETCH_ONGOINGS_REQUEST'
    };
};

const ongoingsLoaded = (ongoings) => {
    return {
        type: 'FETCH_ONGOINGS_SUCCESS',
        payload: ongoings
    };
};

export {
    ongoingsRequested,
    ongoingsLoaded
};
